import React from 'react'

export default function Bascet(props) {

  const { cartItems, onAdd } = props ;
  return (
    <div className='basket-cont'>
      <div className='bascet'>Bascet</div>
      <div>{cartItems.length === 0 && <div>Cart is Bush</div>}</div>
        {cartItems.map((item) => (
         
              <div key={item.id} >
                <div >{item.image}</div>
                <div >{item.name}</div>
                <div className="buttons">
                <button onClick={()=>onAdd(item)} className='add'>+</button>
                <button onClick={()=>onAdd(item)} className='remove'>-</button>
              
                </div>
              
                <div>
                {/* {item.qty} x ${item.price.toFixed(2)} */}
              </div>
              </div>
            
          
        ))}
    </div>
    // </div>
  )
}
